// railway-management-frontend/src/components/Navigation.js
import React from 'react';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/search">
        <button>Search Train</button>
      </Link>
      <Link to="/booking">
        <button>Booking</button>
      </Link>
    </div>
  );
}

export default Navigation;
